import React, { useState } from 'react';

function LoginForm() {
    const [credentials, setCredentials] = useState(0);


    return (
        <form>
            <label>
                User:
                <input type="text" value={credentials.user} onChange={() => setCredentials({ user: credentials.user })} />
            </label>
            <label>
                Password:
                <input type="password" value={credentials.password} onChange={() => setCredentials({ password: credentials.password })} />
            </label>
            <input type="submit" value="Send" />
        </form>
    );
}
